pragma solidity >=0.4.17;

contract Address{
    address public userAddress;
    struct userBlock{
        bytes32 name;
        bytes32 userName;
        bytes32 userType;
        address blockAddress;
        bytes32 password;
        bytes32 mobile;
        bool flag;
    }

    mapping (bytes32 => userBlock) userDb;

    constructor() public{
        userAddress = address(this);
    }

    function checkUserExists(bytes32 mobile) public view returns(bool){
        if(userDb[mobile].flag == true) return true;
        return false;
    }

    function getEncryptedPassword(bytes32 password) public pure returns (bytes32 result){
        return sha256(abi.encodePacked(password));
    }

    function setUser(bytes32 name, bytes32 userName,bytes32 userType, bytes32 password,bytes32 mobile) public{
        if(!checkUserExists(mobile)){
            bytes32 localName = name;
            bytes32 localUserName = userName;
            bytes32 localUserType = userType;
            bytes32 localPassword = getEncryptedPassword(password);
            bytes32 localMobile = mobile;
            userBlock memory user = userBlock(localName,localUserName,localUserType,userAddress,localPassword,localMobile,true);
            userDb[mobile] = user;
        }
    }
}
